ur Pricing Perspective</strong></span></h1>\n<p><span style=\"font-size: 14pt;\">Team communication is at the heart of every business. It\'s the thing that connects your entire organization and has the biggest impact on your culture and productivity.</span></p>\n<p><span style=\"font-size: 14pt;\">For decades, team communication software has been a race to the bottom with clunky and cheap solutions that offer far more frustration than value. We want to change that by offering you a product that just works. And we want it to be a great value for your entire organization - with a growing lineup of new features, helpful on-boarding, and responsive support.</span></p>\n<p><span style=\"font-size: 14pt;\">We believe Slack is an investment in your team and culture. So we set our pricing at a level that allows us to invest in building a solid product, and more importantly, a great experience for you as our customers.</span></p>\n\";s:10:\"margin_top\";s:0:\"\";s:13:\"margin_bottom\";s:0:\"\";s:11:\"margin_left\";s:2:\"60\";s:12:\"margin_right\";s:0:\"\";s:18:\"responsive_display\";s:0:\"\";s:9:\"animation\";s:0:\"\";s:15:\"animation_delay\";s:3:\"0.0\";s:2:\"id\";s:0:\"\";s:5:\"class\";s:0:\"\";s:4:\"type\";s:9:\"rich-text\";s:21:\"flrich1440711748_text\";s:772:\"Our Pricing Perspective\n\nTeam communication is at the heart of every business. It\'s the thing that connects your entire organization and has the biggest impact on your culture and productivity.\n\nFor decades, team communication software has been a race to the bottom with clunky and cheap solutions that offer far more frustration than value. We want to change that by offering you a product that just works. And we want it to be a great value for your entire organization - with a growing lineup of new features, helpful on-boarding, and responsive support.\n\nWe believe Slack is an investment in your team and culture. So we set our pricing at a level that allows us to invest in building a solid product, and more i