le=\"color: #ffffff; font-size: 14pt;\">For decades, team communication software has been a race to the bottom with clunky and cheap solutions that offer far more frustration than value. We want to change that by offering you a product that just works. And we want it to be a great value for your entire organization - with a growing lineup of new features, helpful on-boarding, and responsive support.</span>\n\n<span style=\"color: #ffffff; font-size: 14pt;\">We believe Slack is an investment in your team and culture. So we set our pricing at a level that allows us to invest in building a solid product, and more importantly, a great experience for you as our customers.</span>\";s:21:\"flrich1442252213_text\";s:949:\"<h1><span style=\"font-size: 32pt;\"><strong>Our Pricing Perspective</strong></span></h1>\n<span style=\"font-size: 14pt;\">Team communication is at the heart of every business. It\'s the thing that connects your entire organization and has the biggest impact on your culture and productivity.</span>\n\n<span style=\"font-size: 14pt;\">For decades, team communication software has been a race to the bottom with clunky and cheap solutions that offer far more frustration than value. We want to change that by offering you a product that just works. And we want it to be a great value for your entire organization - with a growing lineup of new features, helpful on-boarding, and responsive support.</span>\n\n<span style=\"font-size: 14pt;\">We believe Slack is an investment in your team and culture. So we set our pricing at a level that allows us to invest in building a solid product, and more importantly, a great experience for you as our customers.</span>\";}}}'),(20,11,'_fl_builder_enabled','1'),(21,11,'_imported_content_block','1'),(22,11,'_imported_by_tesseract_package','color-image-text-box'),(23,12,'wptr_hide_title','0'),(24,12,'_fl_builder_draft','a:18:{s:13:\"55df723499d77\";O:8:\"stdClass\":5:{s:4:\"node\";s:13:\"55df723499d77\";s:4:\"type\";s:3:\"row\";